import React, { useState } from 'react';
import './header.css';
import {
  MDBBtn,
  MDBNavbarLink,
} from 'mdb-react-ui-kit';

export default function Header() {
  const [isVisible, setIsVisible] = useState(true);

  const toggleVisibility = () => {
    setIsVisible(!isVisible);
  };

  return (
    <header>
      <div id='headersec' className='p-5 text-center bg-image'>
        <div className={`header-des ${isVisible ? '' : 'hidden'}`}>
          <div className='d-flex justify-content-center align-items-center h-100'>
            <div className='text-black'>
              <h1 className='mb-3'>Welcome</h1>
              <h3>We offer the highest level of services to our clients</h3>
              <h5 className='mb-4'>Browse our services and make an appointment today</h5>
              <div className='header-buttons'>
                <MDBNavbarLink>
                  <MDBBtn
                    outline
                    rounded
                    className='mx-2 custom-hover'
                    color='dark'
                    href='services'
                  >
                    Services
                  </MDBBtn>
                  <MDBBtn
                    outline
                    rounded
                    className='mx-2 custom-hover'
                    color='dark'
                    href='contacts'
                  >
                    Contact
                  </MDBBtn>
                </MDBNavbarLink>
              </div>
            </div>
          </div>
        </div>
        <div className={`social-icons ${isVisible ? '' : 'hidden'}`}>
          {/* Add your social icons here */}
        </div>
        <div className={`business-name ${isVisible ? '' : 'hidden'}`}>
          {/* Add your business name here */}
        </div>
        <button onClick={toggleVisibility}>Toggle</button>
      </div>
    </header>
  );
}
